print(f"WATER DENSITIES: LIQUID")
for [i, P] in enumerate(pressures):
    print(f"P = {P} MPa")
    row = ""
    for [j, T] in enumerate(temperatures[i]):
        try:  # try using StateOfMatter.Liquid
            D = waterDensityWagnerPruss(T, P * 1e6, StateOfMatter.Liquid)  # from MPa to Pa
        except:  # if StateOfMatter.Liquid caused failure, water is stable in gas state
            D = waterDensityWagnerPruss(T, P * 1e6, StateOfMatter.Gas)  # from MPa to Pa
        row += f"{D.val():.6e}, "
    print(row)

print(f"WATER DENSITIES: VAPOR")
for [i, P] in enumerate(pressures):
    print(f"P = {P} MPa")
    row = ""
    for [j, T] in enumerate(temperatures[i]):
        try:  # try using StateOfMatter.Gas
            D = waterDensityWagnerPruss(T, P * 1e6, StateOfMatter.Gas)  # from MPa to Pa
        except:  # if StateOfMatter.Gas caused failure, water is stable in liquid state
            D = waterDensityWagnerPruss(T, P * 1e6, StateOfMatter.Liquid)  # from MPa to Pa
        row += f"{D.val():.6e}, "
    print(row)
